const { LsiImporter } = require("./lsi/lsi");
const helpers = require("../tools/helpers.js");

module.exports = class LsiExport {
  constructor(config) {
    this.config = config;
  }

  async process() {
    await new LsiImporter().process();
    let prettify = helpers.requireByTemplateType(__dirname + "/prettify.js");
    await new prettify(this.config).process();
  }

};
